CREATE TABLE roles(
    id_roles SERIAL PRIMARY KEY,    
    nom_rol varchar (50) NOT NULL
);

CREATE TABLE direcciones(
    id_direcciones SERIAL PRIMARY KEY,    
    nom_direcciones varchar (50) NOT NULL
);

CREATE TABLE unidades(
    id_unidades SERIAL PRIMARY KEY,    
    nom_unidades varchar (50) NOT NULL
);

CREATE TABLE areas(
    id_areas SERIAL PRIMARY KEY,    
    nom_areas varchar (50) NOT NULL
);

CREATE TABLE cargos(
    id_cargos SERIAL PRIMARY KEY,    
    nom_cargos varchar (100) NOT NULL
);

CREATE TABLE puestos(
    id_puestos SERIAL PRIMARY KEY,    
    nom_puestos varchar (250) NOT NULL
);

CREATE TABLE dominios(
    id_dominios SERIAL PRIMARY KEY,    
    nom_dominios varchar (50) NOT NULL
);

CREATE TABLE usuarios (
    id_usuarios SERIAL PRIMARY KEY,
    ap_usuarios varchar (50) NOT NULL,
    nom_usuarios varchar (50) NOT NULL,
    usu_usuarios varchar (25) NOT NULL,
    ci_usuarios varchar (20) NOT NULL,
    correo_usuarios varchar (50) NOT NULL,
    cont_usuarios varchar (250) NOT NULL,
    este_usuarios int,
    estr_usuarios int,
    est1_usuarios int,
    item_usuarios int,
    fecha_inc date,
    fecha_nac date,
    
    id_roles int,
    CONSTRAINT fk_roles 
        FOREIGN KEY(id_roles)
            REFERENCES roles(id_roles),
   
   id_direcciones int,
    CONSTRAINT fk_direcciones 
        FOREIGN KEY(id_direcciones)
            REFERENCES direcciones(id_direcciones),
    
    id_unidades int,
    CONSTRAINT fk_unidades 
        FOREIGN KEY(id_unidades)
            REFERENCES unidades(id_unidades),

    id_areas int,
    CONSTRAINT fk_areas 
        FOREIGN KEY(id_areas)
            REFERENCES areas(id_areas),
   
   id_cargos int,
    CONSTRAINT fk_cargos 
        FOREIGN KEY(id_cargos)
            REFERENCES cargos(id_cargos),

    id_puestos int,
    CONSTRAINT fk_puestos 
        FOREIGN KEY(id_puestos)
            REFERENCES puestos(id_puestos)
   
   
   
);

CREATE TABLE sistemasait(
    id_sistemasait SERIAL PRIMARY KEY,
    nom_sistemasait varchar(100) NOT NULL,
    url_sistemasait varchar(100) NOT NULL,

    id_roles int,
        CONSTRAINT fk_roles 
            FOREIGN KEY(id_roles)
                REFERENCES roles(id_roles)

);

CREATE TABLE contrase(
    id_contrase SERIAL PRIMARY KEY,
    con_contrase varchar(50) NOT NULL,

    id_sistemasait int,
    CONSTRAINT fk_sistemasait 
		FOREIGN KEY(id_sistemasait) 
			REFERENCES sistemasait(id_sistemasait),
    id_usuarios int,
    CONSTRAINT fk_usarios 
		FOREIGN KEY(id_usuarios) 
			REFERENCES usuarios(id_usuarios)
);

















